import React, { useState } from 'react'

export default function home() {
  const [query, setQuery] = useState<string>("")

  const search
  return (
    <>
      <input
        type="text"
        className="search"
        placeholder="Search..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
      >
      </input>
    </>
  )
}
